import React from 'react';
import Header from './components/Header';
import Footer from './components/Footer';
import HeroCarousel from './components/HeroCarousel';
import DealsPage from './components/DealsPage';

const App = () => (
    <div>
        <Header />
        <HeroCarousel />
        <DealsPage />
        <Footer />
    </div>
);

export default App;
